const styles = {
  section: {
    width: "100%",
    padding: 10,
    minHeight: "100vh" - "80px",
  },
  formData: {
    maxWidth: "550px",
    margin: "25px auto",
    padding: "35px 10px",
    boxShadow: "0 0 15px -10px #2d3748",
    borderRadius: "10px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  form_heading: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
};

export default styles;
